import styled from "styled-components";

const HeaderStyled = styled.div`
	width:100%;
	height:60px;
	background-color:#000;
	display:flex;
	justify-content: center;
	align-items: center;
	position: relative;
	a{
		font-size: 24px;
		color:#666060;
		text-decoration:none;
	padding: 10px;

	}
	.logout{
		position: absolute;
		top: 50%;
		transform: translateY(-50%);
		right: 0%;
	}
`
export default HeaderStyled
